//-----------------------------------------------------------------------------
/**
    Copy target string to destination string.
    pDes size should be nLen + 1;

    @return error code
**/
//-----------------------------------------------------------------------------
void LDPC_SetDisplayName(uint8_t *pDes, const uint8_t *pTarget, uint8_t nLen)
{
    uint8_t n;

    for(n = 0; n < nLen; n++)
    {
        pDes[n] = pTarget[n];
    }
    pDes[n] = 0;                // NULL charactor for the end of the string.
}

//-----------------------------------------------------------------------------
/**
    Initialize LDPC Scheduler Manager variables.

    @return error code
**/
//-----------------------------------------------------------------------------
void ECU_LDPC_InitSchManager(void)
{
    LDPC_SetDisplayName(gLdpcSchManager[0].pSchName, gLDPCSchCodeName0, sizeof(gLDPCSchCodeName0));
    gLdpcSchManager[0].nEnable  = ENABLE;
    gLdpcSchManager[0].nEncSize = sizeof(gLDPCSchEncCode0)/CVT_BYTE_TO_WORD;
    gLdpcSchManager[0].pEncBuf  = (uint32_t)gLDPCSchEncCode0;
    gLdpcSchManager[0].nDecSize = sizeof(gLDPCSchDecCode0)/CVT_BYTE_TO_WORD;
    gLdpcSchManager[0].pDecBuf  = (uint32_t)gLDPCSchDecCode0;
    gLdpcSchManager[0].nParitySize = gLDPCSchParitySize0;
}
